import React from 'react';
import Equipo from './Equipo';

const ListadoEquipos = () => {

    //arreglo de nombres de equipos
    const equipos = [
        {nombre: 'Equipo1'},
        {nombre: 'Equipo2'},
        {nombre: 'Equipo3'}
    ]

    return (
        <ul className="Listado-proyectos">
            {equipos.map(equipo => (
                <Equipo
                    equipo={equipo}
                />
            ))}
        </ul>
    );
}
export default ListadoEquipos;
